        "profilev2.discoverhomeownership.homebuyingconsiderations": "Homebuying Considerations",
        "profilev2.discoverhomeownership.homebuyingconsiderationsbodytext": "If you’re considering buying a home, it’s important to know the risks and advantages. This calculation will help you estimate the benefits of buying a house by using future equity, tax deductions for homeowners, and the net return after making mortgage payments for 30 years. With this information, you can make an informed decision about whether buying a home is the right investment for your financial future.",
        "profilev2.discoverhomeownership.commonterms": "Common Terms:",
        "profilev2.discoverhomeownership.purchasingpower": "Purchasing Power",
        "profilev2.discoverhomeownership.purchasingpowerbodytext": "represents the homebuyer’s ability to purchase a home and make all required payments associated with the home. We allocate 15% of the monthly housing cost for property taxes and home insurance and the remaining amount for the mortgage payment on a #interestRatePlaceholder# fixed interest loan. Traditionally, a down payment of 20% or more is required to avoid having to pay Private Mortgage Insurance (PMI).",
        "profilev2.discoverhomeownership.purchasingpowerbodytextcontinue": 'Freddie Mac, 30-Year Fixed Rate Mortgage Average in the United States [MORTGAGE30US], retrieved from FRED, Federal Reserve Bank of St. Louis; <a target="_blank" href="https://fred.stlouisfed.org/series/MORTGAGE30US">https://fred.stlouisfed.org/series/MORTGAGE30US<\/a>, ',
        "profilev2.discoverhomeownership.futureequitytitle": "Future Equity",
        "profilev2.discoverhomeownership.futureequitybodytext": "estimates the home value available to the homeowner after 30 years, assuming a home is purchased at the available purchasing power and grows between a 3% - 5% average annual home appreciation rate throughout the term of the loan.",
        "profilev2.discoverhomeownership.mortgageinteresttaxdeductiontitle": "Mortgage Interest Tax Deduction",
        "profilev2.discoverhomeownership.mortgageinteresttaxdeductionbodytext": "is a tax incentive allowing homeowners the option to deduct mortgage interest paid throughout the term of their loan during tax season, potentially lowering their tax burden. This amount represents the total mortgage interest paid on up to the first $750,000 of mortgage debt. We recommend consulting a CPA or tax specialist who can guide you through potential tax incentives available to you.",
        "profilev2.discoverhomeownership.netreturn": "Net Return",
        "profilev2.discoverhomeownership.netreturnbodytext": "refers to the difference between the Future Equity and the housing payments made over 30 years.",
